import React from 'react';
import './AdminPage.css';
import AdminNavBar from '../../layout/AdminNavbar';
import UserDescription from '../../layout/UserDescription';
import { useState } from 'react';


function AdminPage() {
  

    return (
        <>
        <AdminNavBar />

        {/* Users Section */ }
        
        <div className='UsersSection'>
            <div className="UsersConainer">
                <h1 className='UsersSectionTitle'>Users list</h1>
                <table id="customers">
                <tr>
                    <th>ID</th>
                    <th>EMAIL</th>
                    <th>FIRST NAME</th>
                    <th>LAST NAME</th>
                   
                </tr>

                <UserDescription 
                id='55'
                email='hh'
                firstname='hh'
                lastname='tt'

                />
                <UserDescription
                 />
                <UserDescription />
                <UserDescription />
                <UserDescription />
                
                </table>
               


                    

            </div>{/* end Users container */ }
        </div>{/* end Users Section */ }
            
        </>
    )
}


export default AdminPage
